    <meta charset="utf-8">
    <style type="text/css">
        .center {
            max-width: 100%;
            max-height: 100%;
            display: block;
            margin: auto auto;
            vertical-align: middle;
        }

        html, body {
            overflow: hidden;
            width   : 100%;
            height  : 100%;
            margin  : 0;
            padding : 0;
			position: fixed;
            display: flex;
        }
        .parent {
            margin: auto;
            background-color: #000;
            display: flex;
            height: 100%;
            width: 100%;
        }
        .centered {
            position: absolute;
            top: 50%;
            left: 50%;
            width   : 80%;
            height  : 80%;
            transform: translate(-50%, -50%);
            z-index: 100;
        }
		video{
			position:absolute; 
			padding: 0;
			margin: 0;
			width: 100%;
			height: 100%;
			object-fit: cover;
			z-index: 10;

			display:none;
		}
		canvas {
            top: 50%;
			left: 50%;
			-webkit-transform: translate(-50%, -50%);
			position:absolute; 
			z-index: 111;
		}
		#icon {
            top: 10px;
			left: 10px;
			-webkit-transform: scale(0.4);
			transform: scale(0.4);
			transform-origin: left top;
			backface-visibility: hidden;
			position:absolute; 
			z-index: 500;
		}
		#scope{    
			left: 50%;
			top: 50%;
			-webkit-transform: translate(-50%, -50%);
			animation-name: scope-anim-reverse;
			animation-duration: 7s;
			animation-iteration-count: infinite;
			animation-timing-function: linear;
			z-index: 112;
		}
		@keyframes scope-anim-reverse {
			0%   {transform:translate(0%,50%);}
			20%   {transform:translate(180%,120%);}
			40%   {transform:translate(-50%,150%);}
			60%   {transform:translate(180%,120%);}
			80%   {transform:translate(130%,150%);}
			100%   { transform:translate(0%,50%);}
		}
		 .btn {
			position: absolute;
			width:200px;
			z-index:200;
			padding: 0.7em 2.1em 0.8em;
			border-radius: 10px;
			margin: 8px 8px 8px 8px;
			animation-name: btn-anim-reverse;
			animation-duration: 0.5s;
			animation-iteration-count: infinite;
			animation-timing-function: linear;
			left: 50%;
			top: 90%;
			-webkit-transform: translate(-50%, -50%);
			color: #fbdedb;
			font-family: sans-serif;
			font-weight: 800;
			font-size: 1.2em;
			text-transform: uppercase;
			text-align: center;
			text-decoration: none;
			-webkit-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			-moz-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			
		}
		.btn2 {
			position: absolute;
			width:100px;
			z-index:200;
			padding: 0.8em 1em 1em;
			border-radius: 10px;
			margin: 8px 8px 8px 8px;
			animation-name: btn-anim-reverse;
			animation-duration: 0.5s;
			animation-iteration-count: infinite;
			animation-timing-function: linear;
			left: 80%;
			top: 5%;
			-webkit-transform: translate(-50%, -50%);
			color: #fbdedb;
			font-family: sans-serif;
			font-weight: 800;
			font-size: 0.8em;
			text-transform: uppercase;
			text-align: center;
			text-decoration: none;
			-webkit-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			-moz-box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
			box-shadow: 0em -0.3rem 0em rgba(0, 0, 0, 0.1) inset;
		}
		@keyframes btn-anim-reverse {
			0% {
				-webkit-transform: translate(-50%, -50%);
			}
			50% {
				-webkit-transform: translate(-50%, -60%);
			}
			100% {
				-webkit-transform: translate(-50%, -50%);
			}
		}
		.btn:hover, .btn:focus {
			opacity: 0.8;
		}
		.btn:active {
			-webkit-transform: scale(0.80);
			-moz-transform: scale(0.80);
			-ms-transform: scale(0.80);
			-o-transform: scale(0.80);
			transform: scale(0.80);
		}
		.btn.block {
			display: block !important;
		}

		.red {
			background-color: #d55050;
		}
		.disable-select {
			user-select: none; /* supported by Chrome and Opera */
		   -webkit-user-select: none; /* Safari */
		   -khtml-user-select: none; /* Konqueror HTML */
		   -moz-user-select: none; /* Firefox */
		   -ms-user-select: none; /* Internet Explorer/Edge */
		}
    </style>


<script charset="utf-8">
	var state = 0;
	var installNow = false;

	var currOrient = "";
	window.oncontextmenu = function(event) {
		 event.preventDefault();
		 event.stopPropagation();
		 return false;
	};
	window.onresize = function(event) {
		handleSize();
	};
	var currOrient = "";
	
	function handleSize(){
		var vid = document.getElementById('gifimage');
		var vidSource = document.getElementById('vidsource');
		var canvasSource = document.getElementById('gameCanvas');
		
		if(window.innerWidth < window.innerHeight){
			var btn = document.getElementById("btn");
			if(btn.className == "btn2 red")
			{
				btn.style.top = 5+"%";
				btn.style.left = 80+"%";
				btn.style.width = 100+"px";
				if(window.innerWidth<=350)
				{
					btn.style.width = 70+"px";
				}
			} else {
				btn.style.top = 90+"%";
				btn.style.left = 50+"%";
				btn.style.width = 200+"px";
			}
		}
		else {
			var btn = document.getElementById("btn");
			if(btn.className == "btn2 red")
			{
				btn.style.top = 10+"%";
				btn.style.left = 85+"%";
				btn.style.width = 100+"px";
			} else {
				btn.style.top = 90+"%";
				btn.style.left = 50+"%";
				btn.style.width = 200+"px";
			}
		}
	}
	function resetCSS(){
		var vid = document.getElementById('gifimage');
		var vidSource = document.getElementById('vidsource');

		vid.style.paddingTop        = 0;
		vid.style.paddingBottom     = 0;
		vid.style.paddingLeft       = 0;
		vid.style.paddingRight      = 0;
		vid.style.height            = "100%";
		vid.style.width             = "100%";
	}
</script>
<script>
	var initTime = new Date().getTime();
	var gameover=0, gameTimeout;
	
	function clickthrough(event){
		event.preventDefault();
		
		if(gameover!=1){
			var newTime = new Date().getTime();
			gameover=1;
			//if(newTime >= initTime+500)
			//{
			initTime = new Date().getTime();
			console.log("state 00: "+initTime);
			console.log("state val: "+state);
			missedStart=0;
			
			var vid = document.getElementById('gifimage2');
			vid.currentTime = 0;
			vid.play();
			vid.style.visibility = 'visible';
			document.getElementById("btn").className = "btn red";
			handleSize();
			state++;
			
			if(gameTimeout) clearTimeout(gameTimeout);
			gameTimeout = setTimeout(function(){
				vid.style.visibility = 'hidden';
				vid.currentTime = 0;
				vid.pause();
				gameover=0;
				document.getElementById("btn").className = "btn2 red";
				handleSize();
			},2700);
			//}
		}
		if(state==1)
		{			
			var btn = document.getElementById("btn");
			btn.className = "btn red";
			btn.style.opacity=1;
			btn.style.zIndex = 200;
		}
	}
	
	function btnevent(event){
		if (window.mraid) {
			mraid.open('https://itunes.apple.com/app/id1535441769');
		} else {
			window.location = 'https://itunes.apple.com/app/id1535441769';
		}
	}
</script>

<body ontouchstart="clickthrough(event)" onmousedown="clickthrough(event)">
<div class="disable-select">

	if(window.innerWidth>window.innerHeight) {
		canvas.width = window.innerWidth;
		canvas.height = window.innerWidth;
	} else {
		canvas.width = window.innerHeight;
		canvas.height = window.innerHeight;
	}
	let gameFrame = 0;
	
	ctx.font = '50px Georgia';
	
	let canvasPosition = canvas.getBoundingClientRect();

	var offset = [vidSource.style.left,vidSource.style.top];
	
	const mouse = {
		x: canvas.width/2,
		y: canvas.height/2,
		click: false
	}
	var clientX, clientY;
	var org1, org2;
	canvas.addEventListener('touchstart', function(e){
		mouse.click = true;
		clientX = e.touches[0].clientX;
		clientY = e.touches[0].clientY;
		mouse.x = clientX - canvasPosition.left;
		mouse.y = clientY- canvasPosition.top;
		
		org1 = mouse.x;
		org2 = mouse.y;

			player.imgSrc = dragtoaim;
		}*/
	});
	window.addEventListener('touchend', function(e){
		mouse.click = false;
		crosshair.alpha=0;
		player.imgSrc=null;
	});
	function onBlur() {
		console.log("lefttab");
		sound.pause();
	};
	function onFocus(){
		vidSource.play();
		console.log("came back");
		sound.play();
	};
	class Crosshair {
		constructor(){
			this.x = canvas.width/2;
			this.y = canvas.height/2;
			this.radius = 1.0;
			//this.height = 20;
			this.angle = 0;
			this.frameX = 0;
			this.frameY = 0;
			this.frame = 0;
			this.spriteWidth = 170;
			this.spriteHeight = 170;
			this.alpha= 1;
			this.sprite= crosshairSprite;
		}
		update(){

		}
		draw(){
			var scF = (window.innerWidth>window.innerHeight)? (canvas.height-100)/this.sprite.height:(canvas.width-50)/this.sprite.width;
			ctx.save();
			ctx.globalAlpha = this.alpha;
			ctx.translate(this.x, this.y);
			ctx.scale(scF, scF);
			ctx.drawImage(this.sprite, 0, 0, this.sprite.width, this.sprite.height, 0 - this.sprite.width/4, 0 - this.sprite.width/4, this.sprite.width * 0.5, this.sprite.height * 0.5);
			ctx.restore();
		}
	}
	const crosshair = new Crosshair();
	class Player {
		constructor(){
			this.x = canvas.width/2;
			this.y = canvas.height/2;
			this.radius = 50;
			//this.height = 20;
			this.angle = 0;
			this.frameX = 0;
			this.frameY = 0;
			this.frame = 0;
			this.spriteWidth = 170;
			this.spriteHeight = 170;
			this.imgSrc = playerSprite;
			this.alpha=1;
		}
		update(){
		
		}
		draw(){
			ctx.restore();
			ctx.save();
			ctx.globalAlpha = this.alpha;
			ctx.translate(canvas.width/2, canvas.height/2+(canvas.height/1.9));
			if(this.imgSrc != null) {
			ctx.drawImage(this.imgSrc, 0, 0, this.imgSrc.width, this.imgSrc.height, 0 - this.imgSrc.width/4, 0 - this.imgSrc.width/4, this.imgSrc.width * 0.5, this.imgSrc.height * 0.5);
			}
			ctx.restore();
		}
	}
	const player = new Player();
	
	function animate(){
		ctx.clearRect(0, 0, canvas.width, canvas.height);
		player.update();
		player.draw();
		crosshair.update();
		crosshair.draw();
		requestAnimationFrame(animate);
	}
	animate();
	
	if (/*@cc_on!@*/false) { // check for Internet Explorer
		document.onfocusin = onFocus;
		document.onfocusout = onBlur;
	} else {
		window.onfocus = onFocus;
		window.onblur = onBlur;
	}
